import {Navigation} from 'react-mdl';

class Login extends Component {

    constructor(props){
        super(props);
        this.state = {
            showComponent: false,
            flag : false 
          };
          this._onButtonClick = this._onButtonClick.bind(this);
    }

    _onButtonClick() {
        console.log("ok")
        this.setState({
          showComponent: true
        });
    }
    render() {
        return (

            <div>
                {
                    this.state.flag ? <span >true </span> : <span >false  </span>
                }
            </div>
        );
    }
}

export default Login;
